/** styling icons  */
export function iconStyle(lineCode) {
    switch (lineCode) {
        case 'M':
            return {
                'background-color': 'rgb(0, 133, 71)',
                'color': 'rgb(255, 255, 255)'
            }
        default:
            return {
                'background-color': 'rgb(0, 91, 149)', 'color': 'rgb(255, 255, 255)'
            }
    }
}
